// src/App.js

import React from 'react';
import Navbar from './Navbar.js';
const certifications1 = ['Certification 1', 'Certification 2', 'Certification 3'];
const certifications2 = ['Certification 4', 'Certification 5', 'Certification 6'];


const Certifications = () => {
  return (
    <div>
        <div className="certifications-page">
      <div className="certifications-container">
        <h2>First Set of Certifications</h2>
        <div className="certifications-list">
          {certifications1.map((certification, index) => (
            <div key={index} className="certification-item">
              {certification}
            </div>
          ))}
        </div>
      </div>

      <div className="certifications-container">
        <h2>Second Set of Certifications</h2>
        <div className="certifications-list">
          {certifications2.map((certification, index) => (
            <div key={index} className="certification-item">
              {certification}
            </div>
          ))}
        </div>
      </div>
    </div>
    </div>
  );
};

export default Certifications;
